INSERT INTO `recomendation` VALUES (1,'Al darle las instrucciones pedirle que las vuelva a repetir para asegurarse que las haya comprendido y que se le facilite realizar lo que se le pidi√≥.',4),(2,'Alterne el trabajo de pupitre con otras actividades que le permitan levantarse y moverse un poco. Como por ejemplo, hacerlo repartir las gu√≠as a los compa√±eros, borrar el pizarr√≥n, etc.',5),(3,'Reforzar las auto-instrucciones que consisten en que el ni√±o o la ni√±a pueda estar ante un problema y poder darse instrucciones a ella misma de qu√© pasos debe realizar para poder resolver el problema que se encuentra frente a ella.',4),(4,'Asignarle actividades de su agrado como dibujar o pintar cuando termine antes que los dem√°s alguna actividad en clase. Tambi√©n se le podr√≠a motivar al pedirle ayuda a que pueda apoyar a otro compa√±ero que est√° teniendo dificultad para realizar la actividad.',4),(5,'Utilizar el juego de ‚ÄúSim√≥n dice‚Ä¶‚Äù que puede fomentar la concentraci√≥n y el seguimiento de instrucciones. Un jugador que asume el papel de ‚ÄúSim√≥n‚Äù tiene que intentar eliminar a todos los jugadores lo antes posible. El ganador del juego es el que consiga seguir todas las instrucciones correctamente.',4),(6,'T√©cnica del sem√°foro: esta consiste en que cuando no podemos controlar una emoci√≥n (sentimos mucha rabia, queremos agredir a alguien, nos ponemos muy nerviosos) tenemos que pararnos como cuando un carro est√° con la luz roja del sem√°foro. Despu√©s de parar, es el momento de pensar y darse cuenta de lo que se est√° sintiendo y por qu√© (luz amarilla). Y si uno se da tiempo de pensar pueden surgir alternativas o soluciones al conflicto o problema. Es la hora de elegir la mejor soluci√≥n (luz verde). Despu√©s de haber aprendido la t√©cnica, van a dibujar una situaci√≥n en la que crean que han perdido el control, y al lado deben de representar c√≥mo estaba su sem√°foro (verde, amarillo o rojo).',5),(7,'Escritura:\r\nRealizar junto al ni√±o ejercicios de planas o que involucren escribir, utilizando letra de molde, ya que la letra de carta implica mayor reto para un ni√±o en edad escolar.',0),(8,'Lectura:\r\nProcurar que el ni√±o lea en voz alta con los padres para aprender la conversi√≥n grafema-fonema. A partir de esta lectura,  los padres pueden corregir al ni√±o; con la pr√°ctica este proceso se vuelve autom√°tico. La lecutra debe ser de total inter√©s para el ni√±o.',0),(9,'Fomentar el conocimiento de las letras por medio de planas y carteles en los que pueda tener un reforzamiento visual de las mismas en casa. Este tipo de refuerzos podr√≠an aplicarse tambi√©n al aprendizaje de signos de puntuaci√≥n.',0),(12,'Respetar su orden y su ritual, es decir, si prefiere guardar los juguetes de una determinada manera, hacerlo igual. As√≠ se conseguir√° empatizar y poder hacer tareas juntos',6),(13,'Haz l√°minas con dibujos de elementos b√°sicos para comer, ba√±arse, vestirse incluso de alimentos. P√©galas en un lugar donde √©l pueda verlas para que se√±ale lo que desea. Puedes preguntarle, ¬øqu√© es? y denomina los objetos t√∫ misma.',6),(14,'Se pueden recortar algunas letras de cart√≥n y colocarlas dentro de un calcet√≠n grande. A la misma vez, poner delante del ni√±o o ni√±a una cartulina con las letras escondidas. El juego consistir√° en que encuentre, dentro del calcet√≠n, las letras que est√°n en la cartulina, para hacer que coincidan. Cada vez que encuentre una letra puede repetirla y motivarla(o) a que repita el sonido.',6),(15,'Facilitar la autonom√≠a en el aprendizaje: planificando horarios, encontrando los mejores m√©todos de estudio, de acuerdo a las capacidades del ni√±o o ni√±a; y la autocorrecci√≥n de actividades y tareas.',7),(16,'Fomentar la cooperaci√≥n entre compa√±eros realizando trabajos en grupos y en parejas. Poner al ni√±o o ni√±a con altas capacidades a trabajar con un ni√±o que se le dificulte el tema o materia. De esta manera trabajar√° sus habilidades sociales y podr√° poner en pr√°ctica lo que se le facilita ayudando a otros.',7),(17,'Motivarlo a buscar diferentes soluciones a un mismo problema, as√≠ se fomentar√° el pensamiento divergente e independiente.',7),(18,'Matem√°tica:\r\nPara manejar la aritm√©tica, el ni√±o debe entender la cantidad que cada n√∫mero representa y el concepto que involucra al resolver un problema. Para ello se pueden realizar recetas de cocina y que pueda identificar la cantidad de cada ingrediente en la receta. As√≠ mismo se pueden trabajar operaciones matem√°ticas (Ej. si para 1 pastel se necesitan 4 huevos, para 5 pasteles, cu√°ntos huevos necesitar√≠amos?).',0),(19,'Para procedimientos matem√°ticos se le puede asignar un color a cada signo (p. ej. (+) de color verde (-) de color rojo (x) de color azul (:) de color naranja). Esto le permitir√° tener otro est√≠mulo del cual apoyarse para poder realizar las operaciones.',0);
