INSERT INTO `test` VALUES (0,'Trastorno de aprendizaje (escritura, lectura y matematica)','Son trastornos con base neurobiol√≥gica, a menudo con un componente gen√©tico que condiciona al ni√±o, a pesar que este tenga una inteligencia normal. El ni√±o puede que no consiga avanzar en uno o m√°s aprendizajes de forma adecuada.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.'),(1,'Acoso Laboral','Se define acoso laboral a una situaci√≥n en la que una persona ejerce una presi√≥n o violencia psicol√≥gica extrema por un per√≠odo prolongado con el fin de destruir la reputaci√≥n o comunicaci√≥n de esta persona con otros colaboradores y forzando a la persona a abandonar su lugar de trabajo. Es muy importante detectarla a tiempo ya que puede ser muy da√±ino para la salud f√≠sica, emocional y mental de uno o varios colaboradores',3,'A continuaci√≥n se le presentan una serie de enunciados a las cuales usted deber√° responder si se encuentra en desacuerdo, indiferente o en acuerdo'),(2,'Clima Laboral','El clima laboral de una organizaci√≥n son las apreciaciones que los colaboradores tienen acerca de las relaciones interpersonales, relaci√≥n con superiores, entre otras que tienen un efecto directo con el desempe√±o de un colaborador al realizer sus responsabilidades dentro de la organizaci√≥n. A trav√©s de esta escala se desea determinar las √°reas de mejora para incrementar su bienestar y satisfacci√≥n',3,'A continuaci√≥n se le presentan una serie de enunciados a las cuales usted deber√° responder si se encuentra en desacuerdo, indiferente o en acuerdo'),(3,'Desgaste Laboral','El desgaste laboral es un s√≠ndrome que se caracteriza por cansancio extremo, cinismo y falta de realizaci√≥n personal. Es un estado de cansancio en el que una persona es c√≠nica acerca del valor de su trabajo u ocupaci√≥n.  Es muy importante detectar este s√≠ndrome para poder ayudar a los colaboradores a tiempo y que mejoren su desempe√±o dentro de su puesto',3,'A continuaci√≥n se le presentan una serie de enunciados a las cuales usted deber√° responder si se encuentra en desacuerdo, indiferente o en acuerdo'),(4,'Trastorno por deficit de atencion','El Trastorno por D√©ficit de Atenci√≥n o TDA, involucra falta de atenci√≥n y concentraci√≥n. Lo que se manifiesta en ni√±os o adolescentes que se les dificultan completar tareas, se distraen con facilidad, cometen errores imprudentes y evitan actividades que requieren de trabajo mental continuo y de mucha concentraci√≥n. Esto finalmente llega a influir en su funcionamiento y rendimiento acad√©mico.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.'),(5,'Trastorno por deficit de atencion con hiperactividad','El perfil hiperactivo-impulsivo se toma como parte del Trastorno por D√©ficit de Atenci√≥n con hiperactividad. En este caso el ni√±o o adolescente tiende a ser inquieto cuando debe permanecer sentado. Continuamente est√° hablando, teniendo grandes dificultades en permanecer callado. En comparaci√≥n, con la poblaci√≥n del subtipo con d√©ficit de atenci√≥n, puede presentar m√°s agresividad. Del mismo modo suelen tener mayores dificultades en establecer relaciones sociales debido a su car√°cter impulsivo. Llegando a afectar finalmente a su funcionamiento y adaptaci√≥n al medio ambiente.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.'),(6,'Trastorno del espectro autista','Los trastornos del espectro autista (TEA) son una falla en la funci√≥n neurol√≥gica con base gen√©tica, los cuales se manifiestan en etapas tempranas a trav√©s de una serie de trastornos en la interacci√≥n social, comunicaci√≥n y falta de flexibilidad en el comportamiento y razonamientos.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.'),(7,'Altas capacidades','Los ni√±os, adolescentes o j√≥venes con altas capacidades son aquellos que muestran evidencia de un rendimiento superior en las √°reas: intelectual, creativo, art√≠stico, liderazgo, o en campos acad√©micos espec√≠ficos. Adem√°s poseen o son capaces de desarrollar estos rasgos y aplicarlos a cualquier √°rea para un valioso desempe√±o.',5,'A continuacion se le presentaran una serie de oraciones a las que usted debera marcar la frecuencia en que el nino/adolescente/adulto presenta cada una de las conductas descritas.');
